INSERT INTO `award_entries` (`id`, `nomination_id`, `category_id`, `name`, `email`, `designation`, `organization_name`, `organization_state`, `organization_city`, `organization_url`, `linkedin_url`, `id_255001`, `id_255002`, `id_255003`, `id_255004`, `id_255005`, `id_255006`, `id_255007`, `id_255008`, `id_255101`, `id_255102`, `id_255103`, `id_255104`, `id_255105`, `id_255106`, `id_255107`, `id_255108`, `id_255201`, `id_255202`, `id_255203`, `id_255204`, `id_255205`, `id_255206`, `id_255207`, `id_255208`, `id_255209`, `id_255301`, `id_255302`, `id_255303`, `id_255304`, `id_255305`, `id_255306`, `id_255401`, `id_255402`, `id_255403`, `id_255404`, `id_255405`, `id_255406`, `id_255407`, `id_255501`, `id_255502`, `id_255901`, `id_255902`, `id_255903`, `stage_status`, `global_status`, `status_2`, `status`, `created_by`, `agent_referral`, `is_idfc_customer`, `agent_name`, `updated_at`, `created_at`) VALUES
(1, '1736431949-42968', '1_DIGITAL', 'Chandrashekar Bharathi', 'chandrashekar@acemicromatic.com', 'Managing Director', 'AceMicromatic Manufacturing Intelligence Technologies Pvt Ltd', 'Karanataka', 'Bangalore', 'www.amitpl.com', NULL, '[\"20 HMT Watch Factory Road, 706, Brigade Rubix 7th Floor\",\"\",\"\"]', '01/06/2013', 'Small', NULL, 'Private Limited', NULL, NULL, NULL, '5 - 24', '5 - 24', '6% - 15%', '> 36%', '11% - 15%', '11% - 15%', '1.6 - 2.0', NULL, '50 - 100', 'More than 80%', 'More than 8', 'We are India\'s 1st mover and leader in Industry 4.0 (digital transformation) and Smart Manufacturing solutions.  \r\n\r\nWith over 20000+ licenses for high value capital assets, and over Rs. 750 Million of shipped revenue, we have created significant ROI impact, and productivity increases of anywhere from 10% to 40%, resulting in an estimated productivity increase of more than Rs. 300 Crores.  \r\n\r\nWe are a proud \"Make in India\" success story, with a high brand equity in our space.', 'Several of our products and solutions are patent pending.\r\n\r\nIndustrial IoT software platform for productivity, quality, maintenance \r\nAutomated process and digital workflow solutions \r\nIoT Edge Gateways \r\nArtificial Intelligence (AI) leveraged agents \r\nDigital Factory Solutions\r\nAutomated scheduler for shop-floors  \r\n... and many more high impact applications for Smart Manufacturing', NULL, NULL, NULL, NULL, ' Our Industrial IoT platform and apps have been built ground up to accommodate the following:\r\n1.  Data ingestion from any machine, any process and any application (agnostic for scaling across any industry vertical)\r\n2. Artificial Intelligence (AI) leveraged insights from real-time high velocity, high volume and high variety data feeds\r\n3. Optimized, innovative Industrial IoT hardware, deisgned with pride in India  ', ' Our products leveraging the above digital and emerging AI technologies have generated over Rs. 750 Million in shipped revenues, and likely to cross the Rs. 1000 Million mark shortly.  Customers have seen their shop-floor productivity and profits increase by up to 40%.  With over 20,000 licenses, we are a recognized brand leader in our space ', ' Since our products and solutions provide insights matrixing in analog and digital process parameters, such as energy, power factor, load, speed, flow and parameters critical for quality and efficiency, customers are able to reduce their machine down times, energy usage, net reduction in labor and capital assets required, enhancing their profits and ability to sustainably deploy resources   ', ' Since our products and solutions have been built to be agnostic to any manufacturing vertical, and the AI leveraged insights are capable of being deployed \"As a Service\", we can expand into existing markets, new markets, and create new infinitely scalable lines of business', NULL, NULL, 'uploads/1736431949-42968/1736434894_g9RvFdTk_Print___Udyam_Registration_Certificate.pdf', 'uploads/1736431949-42968/1736434894_g9RvFdTk_AA290317053089Y_RC08072018.pdf', 'uploads/1736431949-42968/1736434894_g9RvFdTk_ET_LOT_solutions.pdf', 'uploads/1736431949-42968/1736434894_g9RvFdTk_ET_LOT_success.pdf', 'uploads/1736431949-42968/1736434894_g9RvFdTk_ET_LOT_success1.pdf', NULL, NULL, NULL, NULL, 'Chandrashekar Bharathi', 'chandrashekar@acemicromatic.com', '9880291400', '6', 1, 1, 1, 1, 'yes', '0', '1595014714', '2025-02-07 11:42:33', '2025-01-09 14:17:37'),
(2, '1736333642-15472', '1_FAMILY', 'RAVINDRA PUTTEWAR', 'ravi@aits.in', 'MANAGING DIRECTOR', 'ADITI IT SERVICES PVT LTD', 'Maharashtra', 'Nagpur', 'https://aditisg.com/', NULL, '[\"RH-35, NIRMAL NAGARI, UMRED ROAD, NAGPUR , MAHARASHTRA\",\"\",\"\"]', '04/07/2008', 'Micro', NULL, 'Private Limited', NULL, NULL, NULL, '50 - 100', '25 - 49', '> 36%', '> 36%', '< 10%', '5% - 10%', '1.6 - 2.0', NULL, 'Less than 50', 'Ravindra came from humble beginnings in India, the son of a teacher. While the family had little money, his father was determined that Ravindra would attend university, where he graduated as an commerce, aged 20.\r\nHis first job was as an electronics salesman. However, he had always been interested in business. Even though he had no business background, encouraged by a banking friend, Ravindra moved to Nagpur and co-founded a fledgling import/export IT and Telecom business in 1999 just as smartphones where starting to take off in India.\r\n\r\nEmboldened by the demand for IT and with a clear vision of the future, Ravindra launched Aditi in 2004 and set about slowly forming his global network of partners, which supports the business in serving clients locally across the globe today.', 'At Aditi, we pride ourselves on being a one-stop IT solutions provider, dedicated to facilitating your digital transformation journey. From specialized IT & Telecom projects to exclusive OEM services, our team ensures seamless software implementation and robust hardware integration that keeps your IT network secure and up-to-date, wherever you operate around the globe. And with our unwavering 24×7 support, you can trust us to be your reliable partner, propelling your business forward in the ever-evolving tech landscape.\r\n\r\nAt Aditi, we are committed to product quality and seamless integration. That’s why we work closely with our manufacturing partners to deliver OEM solutions we have identified to benefit your individual IT needs.\r\n\r\nOur proficiency spans a wide range of IT and hardware services. From value additions and implementations to crafting bespoke IT solutions, we serve clientele in the Government, Education, Health, Construction, Banking & Financial, Insurance, Aviation and Agricultural industries.', '1st', '3 - 5', '100--', '10 - 15 Years', NULL, NULL, '  We break our holistic integration services into three innovative stages:\r\n\r\nPre-Integration Planning\r\nWe work with you to understand your objectives, ensuring the hardware integration aligns with your business goals.\r\nSeamless Merging\r\nOur experts ensure that new hardware components communicate seamlessly with existing systems, preventing any disruptions.\r\nPost-Integration Testing\r\nAfter the integration process, rigorous testing is conducted to ensure everything operates as intended.', ' We Use the Latest Hardware & Software Technologies\r\nOur team stays continually updated with emerging technologies, ensuring that we recommend only the best and most relevant hardware for your needs. Implementing modern hardware can dramatically enhance performance, security, and overall operational efficiency.', '  Started with Zero investment and today we are Zero debt company. Severe Supply Chain issues faces while doing business from India, we have opened our Singapore office.', '  Company is growing @ more then 30% YOY, have opened offices in many countries and JV in some countries.  ', '  We analysis the risk with our International knowledge partners and we signed rate contract with all our esteem customers to secure our annual sales revenues. ', NULL, 'uploads/1736333642-15472/1736835774_D9pHJU7z_Udyam_MSME_New_Dec_2021_Aditi_IT.pdf', 'uploads/1736333642-15472/1736835774_D9pHJU7z_ROC.PDF', 'uploads/1736333642-15472/1736835774_D9pHJU7z_PRODUCT_AND_SERVICES.pdf', 'uploads/1736333642-15472/1736835774_D9pHJU7z_Aditi_Distribution_Pte_Ltd_ACRA_UPDATED_-29_07_24.pdf', 'uploads/1736333642-15472/1736835774_D9pHJU7z_AWARD_CEO_OF_THE_YEAR.pdf', NULL, NULL, NULL, NULL, 'RAVINDRA PUTTEWAR', 'ravi@aits.in', '9960940559', '5', 1, NULL, 3, 1, 'no', '0', NULL, '2025-02-05 01:13:57', '2025-01-08 10:58:47'),
(3, '1736335372-67820', '1_GLOBAL', 'Dr. Ajay Desai', 'info@qcplworld.com', 'Chairman and Managing Director', 'Quality Catalyst Private Limited', 'Gujarat', 'Vapi', 'www.qcplworld.com', NULL, '[\"1001A & B, B Wing, Sonorous Tower, Near Gandhi Circle, Vapi-Silvassa Road, Vapi (East) - 396195, Gujarat state ,India \",\"\",\"\"]', '10/12/2014', 'Micro', NULL, 'Private Limited', NULL, NULL, NULL, '5 - 24', '5 - 24', '60% - 80%', '60% - 80%', 'Less than 20%', NULL, NULL, NULL, 'Less than 50', 'Less than 50', '30+', 'USA, Dubai, Angola, Malaysia Singapore, UK, New Zealand and many more', '1) Partnered with European international University - Paris, France.\r\n2) Teresa Corea - Angola / Portugal - Business Partnership established for Management consultancy services.\r\n3) Velox Cyber Security Solutions, USA\r\n4) Swift Water Filters, USA / Canada\r\n and various other organizations around the world.', '1) Angola\r\n2) Malaysia \r\n3) Brunei \r\n4) Sierra Leone \r\n5) Thailand, and many more.', 'Internationally renowned, Top & Leading Management Consultant working with more than 2000+ Multinational companies, Big Corporate houses & reputed service industries since 25+ years. We have a team of 25 senior management consultants and 25 experts working as a associates from various fields (from Aerospace to Zink - A to Z) on Global and National levels. We have Globally renowned highly qualified, experienced and intellectual technocrats, lead auditors & trainers. Our offices and associates span across India and internationally, ensuring we can serve effectively anywhere in the world.', 'Various ISO Certification and training, Audits, Turnkey Projects, TPM, TQM, Six Sigma, Product certifications, We guide executives for Career & Education Enhancement, Corporate Skils Development, Marketing and many other services.', NULL, '   One of the many services we provide - ISO 9001. We provide ISO 9001 training, auditing and certification services to various clients around the world. As it is a global standard for quality management, it is a major requirement for our clients. Talking about the diverse international audience, we operate in multiple countries with diverse cultures and variety of different rules and regulations. So to cater them we have to adapt according to their requirements. ', '   Our company had around 1500 clients, and during the last three years we gained 500 more clients totaling our tally to around 2000 corporate clients around the world. Our CMD Dr. Ajay Desai holds various world records for imparting highest no. of corporate training around the world. His name is mentioned in World book, Limca book, Asia Book, India book and London book of world records. Also top newspapers such as - NewYork Weekly and The Wall Street times have published articles on him. ', '   At QCPL, transparency and accountability are core values. We are committed to measuring the impact of our CSR initiatives to ensure our efforts are making a real difference. We regularly track progress through key metrics and report on our achievements, allowing us to adapt and improve our CSR strategy over time.', '    At QCPL, our future expansion and global growth plans focus on targeting multiple continents. Technology, talent and innovation will help us achieve out targets. Talented employees with knowledge of today\'s technology is a blessing, as it makes our task of attracting and connecting with our target audiences easier and efficient so we are also looking to hire ideal candidates who can help us. We will also invest in R&D to understand more about new markets.', NULL, NULL, 'uploads/1736335372-67820/1736409268_nVX67Ojd_QCPL_Udyam_Certificate_New_compressed.pdf', 'uploads/1736335372-67820/1736409268_nVX67Ojd_Screenshot_2025-01-09_131103_(1).pdf', 'uploads/1736335372-67820/1736409268_nVX67Ojd_Screenshot_2025-01-09_130412.pdf', 'uploads/1736335372-67820/1736409268_nVX67Ojd_Screenshot_2025-01-09_130528.pdf', 'uploads/1736335372-67820/1736409268_nVX67Ojd_Dr_Ajay_Desai_–_Global_Profile_(CV)_-_Copy_(3)_compressed.pdf', NULL, NULL, NULL, NULL, 'Dr Ajay Desai', 'info@qcplworld.com', '9824113673', '5', 1, NULL, 3, 1, 'yes', '0', '1595014714', '2025-02-05 01:13:57', '2025-01-08 11:26:46'),
(4, '1736360181-59827', '1_INDIVIDUAL', 'H.E. Dr. Ashish Chopra ', 'world2570@gmail.com', 'President ', 'H.E. Dr. Ashish Chopra ', 'Haryana ', 'Gurgaon ', 'https://www.facebook.com/ashishchopra2570?mibextid=ZbWKwL', NULL, '[\"MA 44 \",\"DLF phase 3\",\"Gurgaon 122002\"]', '14/07/2010', 'Micro', 'Service', 'Sole Proprietorship', '30', '15', '01/12/1972', '5 - 24', '5 - 24', '< 5%', '< 5%', '< 10%', '< 5%', '< 1.0', 'More than 10 Years', 'Underprivileged people of our society ', 'Less than 50', 'Maa Ka Ashirwad- NGO\r\nHelping the underprivileged people of our society.\r\n1) free education \r\n2) distributing free Blankets \r\n3) water conservation plans\r\n4) free clothes and food \r\n5) free spectacles\r\n6) food to street dogs and dana to the birds.', 'Organising blood donation camps and blood donate. I myself have donated blood 73 times. \r\nPlanting of trees. I myself have planted more than 250 trees.\r\nHave Pledged all my body organs.', '2', '8', '1', '6 - 10', NULL, '  I am a Swiss graduate, did my hotel management from Switzerland. If wanted i could lead a luxurious life, but no i always wanted to do something for my country. Thus I choose this line.', '  Yes my organisation faced many many problems with out government help. I found a solution to it, to get everything signed by the Deputy Commissioner, then my team had no problems.', '  Yes it impacted lives of many people.\r\nLike during the pandemic i myself saved more than 10,000 lives in Delhi-NCR. By giving blood or organising blood for the victims. By giving masks , sanitizers and gloves.', ' Yes I have contributed to our society.\r\n1) donating blood 73 times \r\n2) by planting more than 250 trees.', ' My long term vision is that no body in India should die due to deficiency of blood.\r\nThere are 650000 villages in India. Out of which I personally have visited 250000 villages and plan to visit the rest 400000 villages by the end of 2028.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'H.E. Dr. Ashish Chopra', 'world2570@gmail.com', '9810004767', '5', 1, NULL, 3, 1, 'no', '0', NULL, '2025-02-05 01:13:57', '2025-01-08 18:31:30'),
(5, '1736226536-92108', '1_MSME', 'Siddhesh', 'siddhukarambelkar1@gmail.com', 'Executive', 'Value Plus', 'Maharashtra', 'Pune', '', NULL, '[\"Bhandarkar Road\",\"Deccan Gymkhana\",\"Pune \"]', '20/06/2021', 'Small', NULL, 'Sole Proprietorship', NULL, NULL, NULL, '5 - 24', '5 - 24', '< 5%', '6% - 15%', '< 10%', '< 5%', '< 1.0', NULL, 'Less than 50', 'Domestic', 'Brief Description of the Business Brief Description of the Business Brief Description of the Business Brief Description of the Business Brief Description of the Business Brief Description of the Business Brief Description of the Business Brief Description of the Business', 'Core Products / Services Offered Core Products / Services Offered Core Products / Services OfferedCore Products / Services Offered Core Products / Services Offered Core Products / Services Offered Core Products / Services Offered Core Products / Services OfferedCore Products / Services Offered Core Products / Services Offered', NULL, NULL, NULL, NULL, NULL, '   Describe the initiative/product/service that you organization has developed between the period of April 01, 2022, to March 31, 2024, that has led to business success. What was the problem that you aimed to address through the initiative/product/service? ', '   Describe the initiative/product/service that you organization has developed between the period of April 01, 2022, to March 31, 2024, that has led to business success. What was the problem that you aimed to address through the initiative/product/service?', '   Describe the initiative/product/service that you organization has developed between the period of April 01, 2022, to March 31, 2024, that has led to business success. What was the problem that you aimed to address through the initiative/product/service?', '   Outline your organization\'s strategy for scaling operations and adapting to future market demands. Highlight any investments in technology, talent, or infrastructure that demonstrate readiness for future growth. Outline your organization\'s strategy for scaling operations and adapting to future market demands. Highlight any investments in technology, talent, or infrastructure that demonstrate readiness for future growth.', '   Outline your organization\'s strategy for scaling operations and adapting to future market demands. Highlight any investments in technology, talent, or infrastructure that demonstrate readiness for future growth. Outline your organization\'s strategy for scaling operations and adapting to future market demands. Highlight any investments in technology, talent, or infrastructure that demonstrate readiness for future growth.', NULL, 'uploads/1736226536-92108/1736326927_BftIyXMh_Leaders_Of_Tomorrow_Test_Document.pdf', 'uploads/1736226536-92108/1736326927_BftIyXMh_Leaders_Of_Tomorrow_Test_Document1.pdf', 'uploads/1736226536-92108/1736326927_BftIyXMh_Leaders_Of_Tomorrow_Test_Document2.pdf', 'uploads/1736226536-92108/1736326927_BftIyXMh_Leaders_Of_Tomorrow_Test_Document3.pdf', 'uploads/1736226536-92108/1736326927_BftIyXMh_Leaders_Of_Tomorrow_Test_Document4.pdf', NULL, NULL, NULL, NULL, 'Siddhesh', 'siddhukarambelkar1@gmail.com', '8208218346', '6', 1, 0, 1, 1, 'no', '0', NULL, '2025-02-07 11:42:47', '2025-01-07 05:12:16'),
(6, '1736332771-18923', '2_INDIVIDUAL', 'rohit bankoti', 'rohitzidu@gmail.com', 'Founder', 'Cyberstanc', 'new delhi', 'Delhi', 'https://cyberstanc.com/', NULL, '[\"rr cyberstanc llp\",\"Cyberstanc\",\"Cyberstanc\"]', '08/10/2021', 'Medium', 'Manufacturing', 'Partnership', '14', '5', '04/10/1990', '5 - 24', '5 - 24', '16% - 25%', '< 5%', '16% - 20%', '16% - 20%', '1.6 - 2.0', '2 - 5 Years', 'North America, Europe, Asia-Pacific, Latin America, and the Middle East', '50 - 100', 'Financial Institutions\r\nBanks and insurance companies are prime targets for cyber attacks. This engine would help them in real-time monitoring of systems to ensure data integrity, fraud detection, and regulatory compliance.\r\nGovernment and Law Enforcement\r\nThese entities need robust cybersecurity measures to protect sensitive data and national security interests. The scrutiny engine could be used for monitoring and investigation purposes, helping track potential threats or crimes.\r\nHealthcare Organizations\r\nWith sensitive personal health information (PHI) being a target for cybercriminals, healthcare systems can use a scrutiny engine to safeguard patient records, comply with regulations (like HIPAA), and monitor for any unusual access or activities.\r\nE-commerce Platforms\r\nCybersecurity in the retail and e-commerce sector is crucial due to the handling of payment data and customer information. The engine could help identify fraud or breaches in real-time.', 'Scrutiny SDK: A dynamic malware protection tool designed for enterprises and integrators, providing 24/7 support, flexible SLAs, free upgrades, and competitive advantages over solutions like Cisco ClamAV and Blackberry Cylance.\r\n\r\nZero-Day Malware and Ransomware Protection: Advanced simulations that hypothesize, detect, and neutralize threats before they execute. This proactive approach helps secure files and systems from emerging, unknown threats.\r\n\r\nPartnership Opportunities: Offering cutting-edge malware protection for businesses and integrators, with an emphasis on continuous protection and system sanitization.', NULL, NULL, NULL, NULL, NULL, 'Our mission is to revolutionize malware and ransomware protection through the use of advanced simulations, high-performance scrutiny engines, and dynamic, signature-less threat detection. We aim to:\r\n\r\nEmpower enterprises and integrators with high-performance malware protection that prevents zero-day attacks and ransomware outbreaks.\r\nDeliver continuous, around-the-clock support and flexible SLAs to ensure that businesses are always protected and supported.', '  Signature-less Zero-Day Malware Protection: Uses dynamic simulations to detect and neutralize zero-day malware before it runs, even without known signatures.\r\n\r\nHigh-Performance Malware Engine: AI-driven and resource-efficient dynamic protection, ensuring fast performance without compromising security.\r\n\r\nContinuous Real-Time Protection: Provides 24/7 scrutiny to detect and neutralize threats continuously, preventing malware from escaping detection.\r\n\r\n', '50% Reduction in Malware Incidents: A financial sector client reduced zero-day attacks by 50% within 3 months using our signature-less protection and dynamic simulations.\r\n80% Faster Threat Neutralization: A healthcare organization improved ransomware response time by 80%, reducing downtime and protecting patient data.\r\n', 'Workshop: We offer workshops and mentorship to schools, universities, and non-profits, raising awareness and nurturing the next generation of cybersecurity professionals.\r\nDefense/ Government: We provide free or discounted solutions to protect healthcare and public safety sectors, ensuring continued access to essential services.\r\nSustainable Practices: We reduce our environmental impact by using energy-efficient data centers, promoting remote work.', 'Global Expansion: We aim to reach emerging markets and developed regions, offering affordable, high-performance protection worldwide.\r\nAI & Machine Learning Advancements: We will integrate advanced AI to enhance threat detection and real-time protection.\r\nStrategic Partnerships: We plan to expand partnerships with MSPs and IT integrators, extending our reach in the cybersecurity ecosystem.\r\nCloud & IoT Security: We will develop specialized solutions to protect cloud environments and IoT devices.', NULL, 'uploads/1736332771-18923/1736335338_4D6UBI79_CS-compressed.pdf', 'uploads/1736332771-18923/1736335338_4D6UBI79_Certificate_of_LLP_Incorporation.pdf', 'uploads/1736332771-18923/1736335338_4D6UBI79_RB_adhar.pdf', 'uploads/1736332771-18923/1736335338_4D6UBI79_Scrutiny_AntiRansomware_Flyer_Update-compressed.pdf', 'uploads/1736332771-18923/1736335338_4D6UBI79_g20_cyberstanc_crypto_scanner_and_miner_detector.pdf', 'uploads/1736332771-18923/1736335338_4D6UBI79_cs_cert.pdf', NULL, NULL, NULL, 'Rohit Bankoti', 'rohitzidu@gmail.com', '7503662776', '2', 1, 3, 2, 1, 'yes', '0', '1595014714', '2025-02-10 09:03:17', '2025-01-08 10:41:16'),
(7, '1736421978-90268', '2_MSME', 'Prasanna Patwardhan', 'vashistha@prasannapurple.com', 'CMD', 'Prasanna Purple Mobility Solution Pvt. Ltd.', 'Maharashtra', 'Pune', 'https://www.prasannapurple.com', NULL, '[\"396, Shaniwar Peth, Pune 411030\",\"\",\"\"]', '06/11/2007', 'Medium', NULL, 'Private Limited', NULL, NULL, NULL, '50 - 100', '50 - 100', '< 5%', '< 5%', '11% - 15%', '11% - 15%', '< 1.0', NULL, 'More than 400', 'Domestic', 'With over 3 lakh passengers transported daily, Purple stands as India’s foremost bus operator, leading the way in transforming public and private mobility. Specializing in intercity travel, city bus services, BRT systems, and corporate and school mobility, Purple has earned its reputation as a trusted partner in efficient and innovative transportation.\r\n\r\nOur Key Capabilities\r\nCutting-Edge Technology Integration:\r\nPurple leverages advanced technology across its operations, including real-time fleet tracking, AI-powered route optimization, and seamless digital ticketing. These initiatives enhance passenger convenience and operational efficiency.\r\n\r\nDriver Training Excellence:\r\nSafety and quality are at the heart of Purple’s operations. Through structured training programs and workshops, our drivers and staff are equipped to deliver exceptional service while adhering to the highest safety standards.\r\n\r\nInnovative Pilot Programs:\r\nPurple pioneers mobility innovations with trailblazing pilot initiatives, such as the introduction of electric buses, smart transit systems, and other sustainable practices aimed at reshaping the future of transportation.\r\n\r\nTailored Mobility Solutions:\r\nPurple offers customized transportation plans for corporate clients, schools, and institutions, ensuring flexible, reliable, and premium solutions for unique mobility needs.\r\n\r\nSustainability and Green Practices:\r\nPurple is committed to environmental responsibility by investing in low-emission vehicles, promoting green energy, and adopting sustainable practices to reduce its carbon footprint.', 'Intercity Travel:\r\nPurple connects over 100 cities across India with its reliable and comfortable intercity bus services, transporting over 1.5 lakh passengers daily. With AI-driven route optimization, real-time tracking, and ergonomic seating, Purple ensures efficient and stress-free travel while reducing individual vehicle usage, contributing to lower carbon emissions.\r\n\r\nCity Bus Services:\r\nPrasanna Purple serves urban commuters with safe, accessible, and eco-friendly transportation. Equipped with IoT-enabled tracking systems and smart card ticketing, our services provide a seamless daily commute for over 3 lakh passengers while reducing urban congestion and pollution levels.\r\n\r\nBRT Systems:\r\nPurple’s expertise in managing Bus Rapid Transit (BRT) systems has enhanced urban mobility with high-capacity buses running on dedicated corridors, BRT systems reduce commute times and vehicle emissions by 20%, tackling the challenges of traffic congestion and air quality degradation in metropolitan cities.\r\n\r\nCorporate Mobility:\r\nProviding commute solutions to over 500 companies, Purple’s tech-enabled corporate transportation ensures 98% on-time performance and reduces employee commute stress. By offering shared mobility options, we help businesses decrease their environmental footprint, saving tons of CO2 annually.\r\n\r\nSchool Mobility:\r\nPurple transports over 50,000 students daily with a focus on safety and efficiency. Each bus is equipped with GPS tracking, live monitoring, and child safety protocols, ensuring timely pickups and drop-offs. By replacing private vehicles, Purple’s school mobility solutions contribute to safer roads and a 15% reduction in school-zone traffic congestion.', NULL, NULL, NULL, NULL, NULL, '   AI-Powered Route Optimization:\r\nImplementation of advanced AI algorithms to dynamically plan and optimize routes, reducing travel time by 10% and fuel consumption by 2%.\r\nEnabled real-time re-routing based on traffic conditions, ensuring punctuality and reliability\r\n\r\nIoT-Driven Fleet Management:\r\nFleet equipped with IoT devices for real-time tracking, predictive maintenance, and operational monitoring.\r\nImproved fleet availability and uptime by 25%', '   Service Expansion and Geographic Reach:\r\nPurple has extended its reach to new cities and regions, including expanding its intercity travel network and enhancing its metropolitan hubs. This has resulted in a 10% increase in geographic coverage.\r\n\r\nRevenue Growth:\r\nPurple has witnessed a 15% increase in revenue over the past two years, driven by an expanding customer base, new service offerings, and enhanced operational efficiencies. This growth has been propelled by the launch of AI-powered optimizat', '    Transparent Reporting:\r\nPurple maintains transparency in all our business practices. We adhere to the highest standards of governance and ethical conduct, ensuring that all our stakeholders are informed about our sustainability efforts and progress\r\n\r\nEthical Sourcing and Procurement:\r\nIn line with our commitment to sustainability, we ensure that our procurement processes are responsible and sustainable. We prioritize vendors and suppliers who demonstrate a commitment to ethical labor practices.', '   Electric / Hybrid Fleet Expansion: With sustainability at the core of our long-term strategy, Purple has invested in electric and hybrid buses as part of our green fleet initiative. By 2025, we aim to have 25% of our fleet powered by electric vehicles.\r\n\r\n\r\nSmart Infrastructure: Purple is upgrading its infrastructure to be more adaptable and energy-efficient. This includes solar-powered charging stations and smart energy management systems for our bus depots and terminals.\r\n\r\n', '   At Purple, we understand that over 80% of the country’s population relies on buses for their daily commute, and the backbone of the transportation industry is its blue-collar workforce—the drivers, mechanics, wiremen, and supervisors who ensure our services run smoothly every day. This critical workforce is at the heart of everything we do, and to empower them and improve service delivery, we’ve introduced an innovative workforce training program designed to integrate advanced technology into t', NULL, 'uploads/1736421978-90268/1736508944_teWg2RJu_Print___Udyam_Registration_Certificate_-Downloaded_on_21_9_24.pdf', 'uploads/1736421978-90268/1736508944_teWg2RJu_CERTIFICATE_OF_CHANGE_OF_NAME_PRASANNA_PURPLE.pdf', 'uploads/1736421978-90268/1736508944_teWg2RJu_Prasanna-Purple_compressed.pdf', 'uploads/1736421978-90268/1736508944_teWg2RJu_Prasanna-Purple-Impack_compressed.pdf', 'uploads/1736421978-90268/1736508944_teWg2RJu_Other.pdf', NULL, NULL, NULL, NULL, 'Vashistha Chawda', 'vashistha@prasannapurple.com', '9869832328', '6', 1, NULL, 3, 1, 'yes', '0', '5167681127', '2025-02-05 01:13:57', '2025-01-09 11:32:10'),
(8, '1736398606-28703', '3_MSME', 'Jeyakumar S', 'nanda@raphacure.com', 'Founder Managing Director', 'Cure and Care Primary Care Private Limited', 'Karnataka ', 'Bangalore', 'https://www.raphacure.com/', NULL, '[\"No. 208, MJ Lifestyle Aldilla, Begur Road,\",\"Opp High School, Bangalore 560068\",\"\"]', 'Cure and Care Primary Care Private Limited', 'Micro', NULL, 'Private Limited', NULL, NULL, NULL, '5 - 24', '5 - 24', '< 5%', '> 36%', '< 10%', '> 20%', '> 3.0', NULL, 'Less than 50', 'Domestic', 'Raphacure offers a wide range of integrated healthcare services, including B2C lab tests, telemedicine, B2B lab services, phlebotomy, and annual health checkups. With a rapidly expanding clinic network and strategic investments in technology and manpower, Raphacure is well-positioned to capitalize on the growing healthcare market. Anywhere Access to Affordable Care is our driving philosophy.\r\n\r\nIn India, many patients trust doctor prescriptions without question. While doctors play a crucial role in guiding healthcare, this trust sometimes leads patients to follow prescribed treatments that are unnecessarily expensive. Many people end up paying hefty sums for wellness prescriptions that could have been more affordable.\r\nRaphaCure is dedicated to changing this by providing a transparent, cost-effective solution. We aim to reduce prescription costs by offering access to high-quality yet affordable healthcare options. Our platform provides a second opinion on prescriptions, ensuring that patients get the care they need without overspending.\r\n', 'Our Core Products and Services are driven through the AI and Patent applied technological platform.\r\nThe platform is powered with appointment management system, health records storage, eprescriptions, communication system, wellness resources, etc. This is complied with information systems, privacy policies, SOC1 and SOC2 Audits, ISO/IEC 27001:2022, etc.\r\n\r\nThey are classified as below\r\n1. Consultations : \r\nVirtual Consultations and OPD Consultations under below sections\r\nThey can choose their doctor and mode of consultation.\r\n\r\nDoctor Consultations\r\nMental Wellness Consultations\r\nWomens Care\r\n\r\n2. Diagnostic: Centre visits, Camps, and as Home Service for below sections\r\nThe platform is designed for the users to choose their service provider, individual tests or packages as per their convenience.\r\n\r\nLab Tests \r\nRadiology \r\nEye Care\r\nDental Care\r\n\r\n3. Medicines:\r\nWe have a patent applied system where the users can choose either generic or branded when their prescriptions are uploaded. We provide an option with price and help the users take informed decision.\r\nThe medicines are delivered to their home or their chosen place.\r\n\r\nPharmacy - Allopathic medicines\r\nAyurveda - Ayurvedic medicines \r\nWellness products are available to buy as OTC product.\r\n\r\n4. Emergency:\r\nWe also provide emergency interventions if required in the form of\r\nAmbulance service\r\nBlood Bank assistance\r\n\r\n5. Fitness:\r\nOne of the drivers of wellness is Fitness and we offer the users the choice of fitness.\r\nFitness - Gym, SPA, Pilates, Yoga, etc\r\nMental Wellness - Our mental coaches help develop mental fitness to users.\r\n\r\n\r\n\r\n\r\n', NULL, NULL, NULL, NULL, NULL, ' Access to quality care was only focused on metros and tier1 cities and the users were not sure of the profile of the service providers as well as there were no transparency in pricing. This led to exploitation of patients and delay in medical diagnosis means issues with saving of lives.\r\n\r\nOur initiative was to create a technological platform that was powered with AI, RPA, and Communication bots. We developed a complete digital solution to the individual users, corporate users, and the service providers. We also developed products and services with a view to encourage users the options to consult not just the modern medicine but also alternate medicines such as Ayurveda, Homeopathy, Yoga, Naturopathy, Unani, Siddha, Acupuncture, etc.\r\n\r\nInnovation 1 : Workflow automation system:\r\nDigitization of the workflow helped in Accessing Information, Consultation, Reports, and Medicine Delivery to the patients and doctors faster than anyone else in the market. This saved Time, helped choose their options, access health records, and early diagnosis and saving lives for the users. \r\n\r\nInnovation 2: Comparison of Generic vs Branded Medicines:\r\nWe have created a system where the users can see the comparison of generic vs branded medicines with price options. This is applied for a patent. This helps users to take informed decisions and there is no forcing on them to decide. \r\n', '  These innovations helped us grow the overall revenue from Rs. 5 Crores to Rs. 9.11 Crores in the measurement period.\r\nOn an average we were able to service 550 calls per day although we have a capacity to handle 1500 calls per day. \r\n\r\nThis helped us to have a Strategic partnership with Madhavbaug who has a chain of 330 ayurvedic clinics which we helped them convert into Digital Clinics. This resulted in additional revenue of Rs. 12 lakhs, 60,000 transactions, and access to 2 lakhs data. \r\nStrategic Investment of Rs. 1 Crore by Vaidya Sane Ayurved Laboratories Limited (Brand Name - Madhavbaug) and Joins Advisory Board. \r\n\r\nMedicine Delivery: \r\nStarted delivery of medicines. From Zero to Rs. 8.48 Lakhs revenue generated.\r\nAdded new service, Phlebotomy Services. This grew from Zero to Rs. 56 Lakhs.\r\n\r\nOverall Impact:\r\nReceived startup awards\r\nfrom India 5000 for Quality Service and Best Startup;\r\nBest Wellness Startups for Digital Healthcare Solutions from Blindwink, Taj and Zee Business in Nov 2022;\r\nSelected for the 1st Cohort of UK-India Healthtech Bootcamp in March 2023 for Workflow Automation\r\n\r\n', ' We have digitized 70% of the tasks for our vendors and users resulting in paperless transactions. This has helped add carbon footprint.\r\n\r\nWe support the UN SDG No.3 - Good Health and Wellbeing, which has been the driving force.\r\n\r\nThis motivated our team to create a greenery inside the office, creating eco-friendly gardens, lawns, and landscaped workstations that is embedded with nature.  \r\nThis encouraged better engagement with our visitors and employees \r\n', '  Key Growth Drivers\r\n1. Clinic Network Expansion: Increasing the number of clinics from 330 in FY24 to 440 by FY28, benefiting both B2B and B2C clients.\r\n2. Prescription Growth: Increasing prescriptions per clinic from 0.5 to 5 per day, leading to significant revenue growth for both B2B and B2C services.\r\n3. Ticket Size Growth: Enhancing the average ticket size from INR 650 to INR 900 by FY28, driven by improved service offerings in both B2B and B2C markets.\r\n\r\nFuture Readiness:\r\n1. We are developing internal talent to support the technological advancements, market share increase while our infrastructure is ready for scale.\r\n2. Our scalability is governed by the above 3 key drivers which need investment to the tune of Rs.10 Crores to reach from Rs.9.11 Crores in FY 24 to Rs. Rs. 100 Crores in FY 28. This investment will have a break up of 50% for Technology, 30% for Talent building, and 20% for marketing.\r\n', '  Our most significant innovation has been Workflow automation which has reduced Time of care and cost to the users.\r\nWe have a patent applied for this method.\r\nA review of industry comparison\r\nCure and Care: 40 Employees managing 550 calls per day, which is 13.75 calls per employee per day.\r\nCompetition 1: 500 Employees managing 250 calls per day, which is 0.50 calls per employee per day.\r\nCompetition 2: 750 Employees managing 500 calls per day, which is 0.67 calls per employee per day.', NULL, 'uploads/1736398606-28703/1736961156_3WmlRwgt_MSME_Registration_Certificate_2024-compressed.pdf', 'uploads/1736398606-28703/1736961156_3WmlRwgt_COI-compressed.pdf', 'uploads/1736398606-28703/1736961156_3WmlRwgt_RC_Services_15Jan25.pdf', 'uploads/1736398606-28703/1736961156_3WmlRwgt_Impact_deck-compressed.pdf', 'uploads/1736398606-28703/1736961156_3WmlRwgt_Certificates_15Jan25.pdf', NULL, NULL, NULL, NULL, 'Nanda Kumar ', 'nanda@raphacure.com', '9900303896', '6', 1, NULL, 3, 1, 'yes', '0', '1595014714', '2025-02-05 01:13:57', '2025-01-09 05:09:13'),
(9, '1736413850-95824', '4_MSME', 'Kailash dawani', 'vinesh.dawani17@gmail.com', 'Director', 'Vinesh Agency', 'Madhya Pradesh', 'Indore', 'https://www.hastytastypoha.com', NULL, '[\"327\\/5\\/2 palda industrial area\",\"\",\"\"]', '01/07/1998', 'Micro', NULL, 'Sole Proprietorship', NULL, NULL, NULL, '5 - 24', '5 - 24', '< 5%', '< 5%', '< 10%', '< 5%', '< 1.0', NULL, 'Less than 50', 'Domestic', 'Serving Consumer Packaging Poha since 1998 in name of HASTY TASTY . Being the first brand PAN INDIA to serve this category.\r\nLeaders in consumer space in this category product by a fair margin .\r\nSupplying to all the major modern retail players like big basket , metro , dmart etc', 'Hasty Tasty Poha\r\nHasty Tasty Roasted chana\r\nHasty Tasty Sabudana', NULL, NULL, NULL, NULL, NULL, '  we are one of a kind when it comes automated production and quantum in our category . We are ONLY brand pan India to have 4 variants of consumer category POHA with an aim to cater customer from different states and preferences making us a truly LOCAL INDIAN brand.', '  Past two years we have grown our metrics in terms of customer satisfaction and reach . We are now available in more than 14 states which in itself defines our drive to acquire consumer . Also DMART and Reliance(jio) B2B are our best foot forward in the past two years.', '  Being more of a breakfast brand we try to fill the stomach of the needy . In the sense our initative \'har raviwar , poha aur pyar\' defines our initiative to serve orphans , front line nagar nigam workers as well as traffic police men .', '  We are coming up with fully automised plant in Indore at 1,10,000 sq ft in order to be more prepared and serve better to our estimeed clients .We are highly investing in the future in terms of grooming our employees as well as hiring more capable workforce . ', '  1998 , the year when grains and grocery were sold in a loose polythene We came up with INDIA\'s first consumer brand poha in 1kg pack .\r\nHistory has it we haven\'t looked beyond that ever since and tried to move forward in terms of acquiring GT as well as mordern with regular updates in Packaging , quality and effectiveness .\r\nNO one in entire MP , CG does even half of per day consumption as we would just in the consumer packaging space .\r\nAlso the word has it we work only on one kind of marketing stratergy - WORD OF MOUTH , which has brought us here in past 26 odd years.', NULL, 'uploads/1736413850-95824/1737026920_CP7VMWhr_vineshmsme_udyam_certificate.pdf', 'uploads/1736413850-95824/1737026920_CP7VMWhr_vineshGST_NEW_CERTIFICATE_(1).pdf', 'uploads/1736413850-95824/1737026920_CP7VMWhr_vineshHasty_Tasty_Product_Brochure_FY_2024-25_(1)_11zon.pdf', 'uploads/1736413850-95824/1737026920_CP7VMWhr_vineshHasty_Tasty_Product_Brochure_FY_2024-25_(1)_11zon1.pdf', 'uploads/1736413850-95824/1737026920_CP7VMWhr_vineshHasty_Tasty_Product_Brochure_FY_2024-25_(1)_11zon2.pdf', NULL, NULL, NULL, NULL, 'Vinesh Dawani', 'vinesh.dawani17@gmail.com', '9755032777', '6', 1, NULL, 3, 1, 'yes', '0', '5167681127', '2025-02-05 01:13:57', '2025-01-09 09:12:36'),
(10, '1736417110-84913', '5_MSME', 'GAUTAM CHANDU', 'adm.harirameng@gmail.com', 'OWNER', 'HARIRAM ENGINEERING', 'Gujarat', 'Surat', 'https://www.hariram.in/', NULL, '[\"B 46 TO 50 MARUTI INDUSTRIAL ESTATE\",\"PANDESARA,SURAT\",\"GUJARAT\"]', '04/07/2017', 'Small', NULL, 'Sole Proprietorship', NULL, NULL, NULL, '5 - 24', '5 - 24', '6% - 15%', '6% - 15%', '< 10%', '5% - 10%', '1.0 = 1.5', NULL, 'Less than 50', 'Domestic', 'We are manufacturer of paper disposable products machinery, paper converting machinery and printing machinery.\r\nwide range of paper disposable products machines like.. paper plate machine, dona machine, tissue paper machine, lamination machine etc...\r\n\r\nwe are also dealing in screen printing machines, UV foil transfer machines, and screen exposure machine', 'paper plate machines,\r\nfoil trans machine\r\nbuffet plate machine\r\npaper lamination machine (hot/cold)', NULL, NULL, NULL, NULL, NULL, '  HR 133 NEW MACHINE LAUNCH \r\nBUFFET PLATE MAKING MACHINE ', '  NEW FOIL PRINTING MACHINE LAST TWO YEAR WE CREATE INDIAN MACHINE IN FOIL PRINTING ', '  WE DO BUSINESS FOR PEOPLE GROWTH AND WE GAVE OPPURTIUNE TO DO OWN YOUR BUSINESS ', '  WE CREATE A SYSTEM PROCESS FOR ALL DEPARTMENT TO DO WORK PROPERLY ', '  WE GIVE SERVICE TO OUR CUSTOMER FOR 24 HOURS,WE CREATE ALWAYS NEW THINGS FOR UPDATE AND LEARN FROM OTHERS TO GROWTH OUR BUSINESS ', NULL, 'uploads/1736417110-84913/1738243580_MT7L1kCe_MSME_CERTI.pdf', 'uploads/1736417110-84913/1738243580_MT7L1kCe_HARIRAM_ENGINEERING_FACTORY.pdf', 'uploads/1736417110-84913/1738243580_MT7L1kCe_Foil_trans_machine_HR_201.pdf', 'uploads/1736417110-84913/1738243580_MT7L1kCe_Foil_trans_machine_HR_2011.pdf', 'uploads/1736417110-84913/1738243580_MT7L1kCe_Foil_trans_machine_HR_2012.pdf', NULL, NULL, NULL, NULL, 'Gautam chandu ', 'adm.harirameng@gmail.com', '9427231747', '6', 1, 3, 1, 1, 'yes', 'no', '5167681127', '2025-02-10 07:21:54', '2025-01-30 18:59:21'),
(11, '1736409638-91085', '6_MSME', 'SibaPrasad Tripathy', 'sales.dapspl@gmail.com', 'Proprietor ', 'Bhoomi Consultancy ', 'Orissa', 'Bhubaneswar', '', NULL, '[\"Maruti Residency \",\"Nandankanan Road\",\"Raghunathpur \"]', '05/07/2021', 'Small', NULL, 'Sole Proprietorship', NULL, NULL, NULL, '5 - 24', '5 - 24', '< 5%', '< 5%', '< 10%', '< 5%', '1.0 = 1.5', NULL, 'Less than 50', 'Domestic', 'Property and clothes . Good yyyyy67yyyyyyyyyyyyyyyyyyyyyuu', 'Nayy6yyy6yyyyyuuyyyyyyyyyyyyyyyyyuyyyyyyyyyyyyyyyyy', NULL, NULL, NULL, NULL, NULL, '  Yyyyyyyyyyyyyyyyyyuuyyy6yyyuyyyyyyyyyyyyyyy6y6yyyyyu', '  Yyy6yyyyyyyyyyyyyyyyyy6yyyyy6yyyyyyyyyyyyyyyyyyyyyyy', '  Yyyyyy6yyyyuuuuuuhhhhhhhhhhhyyyyyyyyyyyyyyyyyyyy', '  Good6yyuuu7uuuuuuuuuuuuuuuuuuuu7uhhuuuuuuuuuuuu', '  Yyyyyyyyyyyyyyyyyyyyyyyyyyuyyyyyyyyyyyyyyyyyyyyyyyy', NULL, 'uploads/1736409638-91085/1738291367_Zzek78vQ_BHOOMI_CONSULTANCY-NEW_Udyam_Registration_Certificate.pdf', 'uploads/1736409638-91085/1738291367_Zzek78vQ_BHOOMI_CONSULTANCY-GST_CERTIFICATE_1ST_PAGE.pdf', 'uploads/1736409638-91085/1738291367_Zzek78vQ_BHOOMI_CONSULTANCY.pdf', 'uploads/1736409638-91085/1738291367_Zzek78vQ_BHOOMI_CONSULTANCY1.pdf', 'uploads/1736409638-91085/1738291367_Zzek78vQ_BHOOMI_CONSULTANCY2.pdf', NULL, NULL, NULL, NULL, 'SIBA PRASAD TRIPATHY ', 'sales.dapspl@gmail.com', '8270150416', '5', 1, 3, 1, 1, 'yes', 'no', '5167681127', '2025-02-10 07:32:08', '2025-01-31 08:15:50');
INSERT INTO `award_entries` (`id`, `nomination_id`, `category_id`, `name`, `email`, `designation`, `organization_name`, `organization_state`, `organization_city`, `organization_url`, `linkedin_url`, `id_255001`, `id_255002`, `id_255003`, `id_255004`, `id_255005`, `id_255006`, `id_255007`, `id_255008`, `id_255101`, `id_255102`, `id_255103`, `id_255104`, `id_255105`, `id_255106`, `id_255107`, `id_255108`, `id_255201`, `id_255202`, `id_255203`, `id_255204`, `id_255205`, `id_255206`, `id_255207`, `id_255208`, `id_255209`, `id_255301`, `id_255302`, `id_255303`, `id_255304`, `id_255305`, `id_255306`, `id_255401`, `id_255402`, `id_255403`, `id_255404`, `id_255405`, `id_255406`, `id_255407`, `id_255501`, `id_255502`, `id_255901`, `id_255902`, `id_255903`, `stage_status`, `global_status`, `status_2`, `status`, `created_by`, `agent_referral`, `is_idfc_customer`, `agent_name`, `updated_at`, `created_at`) VALUES
(34, '1736584391-06791', '7_MSME', 'Ravikanth R Bandakunta', 'info@fwdspace.com', 'CEO/Founder', 'Forward Space Logistics Pvt. Ltd. ', 'Telangana', 'Hyderabad', 'https://fwdspace.com/', NULL, '[\"S. No.: 629, Devara Yamjal Rd., Near Kompally(NH44), Medchal Dist., Hyderabad TG IN\",\"\",\"\"]', '10/12/2019', 'Micro', NULL, 'Private Limited', NULL, NULL, NULL, '5 - 24', '5 - 24', '< 5%', '6% - 15%', '11% - 15%', '11% - 15%', '1.6 - 2.0', NULL, '100 - 200', 'Domestic', 'Forward Space Logistics works closely with management to overcome the difficulties that their distribution networks provide and to help them become more efficient and productive. Established in 2010 as one of the Best Warehousing Management Services, we have been providing top-notch warehousing services to our clients and expanded into the logistics business in 2019. Whether you need warehouse space in Hyderabad or are looking for comprehensive Logistic Service Providers In Hyderabad.\r\n\r\n', 'Services offered at Forward Space Logistics.\r\n\r\n‣ Contract Logistics (3/4 Party Logistics)\r\n‣ Project Cargo\r\n‣ Warehousing\r\n‣ Multi-Model Freight \r\n‣ Custom House Agent\r\n‣ Other services including Packaging, Bar-Coding, Inventory Management.”\r\n\r\n', NULL, NULL, NULL, NULL, NULL, '  Innovation and adaptability are the cornerstones of success in today’s fast-paced world. Innovation drives progress by encouraging new ideas, technologies, and approaches that solve complex problems and enhance efficiency. It fosters a culture where creativity is valued and challenges are seen as opportunities for growth. By constantly evolving, businesses stay ahead of the curve, offering cutting-edge solutions that meet the changing needs of customers and markets.\r\n\r\nAdaptability is equally important, as it ensures businesses can quickly adjust to unexpected changes or disruptions. In an era of rapid technological advancements, global market shifts, and unpredictable events, adaptability allows companies to remain resilient and thrive. Organizations that embrace change, learn from their experiences, and pivot when necessary are better equipped to face uncertainty and stay competitive.\r\n\r\nTogether, innovation and adaptability create a dynamic environment where businesses can not only survive but also lead. By fostering both qualities, companies can unlock new possibilities, drive growth, and maintain relevance in a constantly evolving world.\r\n', '  \r\nBusiness performance and market impact are two critical measures of a company’s success and long-term viability. Business performance refers to how well a company meets its goals, maximizes profits, optimizes resources, and ensures operational efficiency. It is often evaluated through key performance indicators (KPIs) like revenue growth, profitability, customer satisfaction, and employee productivity. Strong business performance demonstrates the company’s ability to execute its strategy, adapt to challenges, and manage its operations effectively.\r\n\r\nMarket impact, on the other hand, reflects a company’s influence within its industry and broader market. This includes how a business shapes trends, meets consumer needs, and competes against other players. A strong market impact can be seen through brand recognition, customer loyalty, market share, and innovation. A company that significantly alters its market landscape, introduces new products, or leads industry shifts is often considered a market leader.\r\n\r\nTogether, both business performance and market impact determine a company’s ability to sustain growth, attract investment, and maintain a competitive edge, shaping its future success in an ever-changing marketplace.\r\n', '  At Forward Space Logistics Pvt. Ltd., we recognize that true business success goes beyond profitability—it includes a commitment to sustainability and social responsibility. We are dedicated to minimizing our environmental impact through responsible logistics practices, ensuring that our operations are as efficient and eco-friendly as possible. By optimizing transportation routes, utilizing fuel-efficient vehicles, and reducing waste, we strive to reduce our carbon footprint while maintaining high service standards. We also prioritize the use of sustainable materials in packaging and consistently seek out innovative solutions that support long-term environmental health.\r\n\r\nOur approach to social responsibility is rooted in our dedication to creating positive change within our communities and for our workforce. At Forward Space Logistics, we believe in fair labor practices, providing safe working conditions, and offering opportunities for skill development to our employees. We also actively engage in supporting local initiatives, from education programs to community welfare projects, aiming to create a lasting positive impact in the areas where we operate.\r\n\r\nThrough our ongoing commitment to both sustainability and social responsibility, we aim to not only lead by example within the logistics industry but also to contribute to a more sustainable and equitable world. At Forward Space Logistics, we understand that long-term success is built on responsible actions that benefit both the environment and society.\r\n', '  Scalability and future readiness are key factors that drive the long-term success of a business, particularly in industries that require constant adaptation and growth.\r\n\r\nScalability refers to a company’s ability to grow and manage increased demand without sacrificing performance or efficiency. It’s about creating systems, processes, and structures that can easily expand as the business grows. For Forward Space Logistics Pvt. Ltd., scalability means investing in advanced technologies, infrastructure, and a flexible workforce to handle larger volumes of shipments, more complex logistics operations, and a broader geographical reach. By building scalable operations, we ensure that our company can meet the evolving needs of our customers while maintaining cost-effectiveness and service quality.\r\n\r\nFuture readiness, on the other hand, is about anticipating changes in the market, technology, and consumer behavior, and being prepared to adapt quickly. It involves staying ahead of trends, embracing innovation, and making proactive investments that will support future growth. At Forward Space Logistics, we continuously evaluate emerging technologies, such as AI and automation, to enhance our service offerings. We also focus on sustainability and digital transformation to ensure that we are well-equipped to thrive in the rapidly changing logistics landscape.\r\n\r\nBy prioritizing both scalability and future readiness, Forward Space Logistics Pvt. Ltd. is positioned for sustained growth, allowing us to serve our clients efficiently and remain a competitive leader in the logistics industry.\r\n\r\n', '  Ravikanth, the visionary behind Forward Space Logistics Pvt. Ltd., is a deserving recipient of the **Entrepreneur of the Year** award. Under his leadership, the company has experienced remarkable growth, positioning itself as a leader in the logistics industry. Ravikanth’s ability to innovate, adapt to changing market dynamics, and optimize business processes has been key to Forward Space Logistics’ success.\r\n\r\nHis forward-thinking approach to integrating advanced technologies such as AI and real-time logistics tracking has not only improved operational efficiency but also enhanced customer satisfaction. Ravikanth has consistently demonstrated a deep understanding of the industry\'s challenges and has worked tirelessly to develop sustainable, scalable solutions that meet the evolving needs of the market.\r\n\r\nBeyond his business achievements, Ravikanth has prioritized social responsibility and sustainability, ensuring that Forward Space Logistics operates with a commitment to environmental stewardship and community support. His focus on creating a positive workplace culture and offering opportunities for employee growth has further solidified his leadership and impact.\r\n\r\nRavikanth’s dedication to excellence, innovation, and responsibility makes him a true role model for aspiring entrepreneurs. His contributions to the logistics industry and his commitment to a better future through business practices set a standard for others to follow. Forward Space Logistics’ continued success is a direct reflection of his exceptional leadership and entrepreneurial spirit.\r\n\r\n', NULL, 'uploads/1736584391-06791/1737618120_WhReJLfc_22179d459ebe-Certificate__2_.pdf', 'uploads/1736584391-06791/1737618120_WhReJLfc_4e30699f487b-FSLPL_INCORPORATION_CERTIFICATE.pdf', 'uploads/1736584391-06791/1737618120_WhReJLfc_All_PDF_Maker_20250123_13_10_02.pdf', 'uploads/1736584391-06791/1737618120_WhReJLfc_70f77291ccde-Impact_Assessment_Report.pdf', 'uploads/1736584391-06791/1737618120_WhReJLfc_All_PDF_Maker_20250123_13_10_021.pdf', NULL, NULL, NULL, NULL, 'Ravikanth R Bandakunta', 'info@fwdspace.com', '9494856464', '2', 1, NULL, 2, 1, 'yes', '0', '1595014714', '2025-02-10 09:03:02', '2025-01-11 08:46:26'),
(35, '1736502899-24703', '8_MSME', 'Humaid shaikh', 'humaidshaikh29@gmail.com', 'Business Development Head', 'SOciomark', 'Maharashtra', 'Medinipur', 'https://www.sociomark.in/popup-lead', NULL, '[\"asfafasfasf\",\"asfsafasfsafas\",\"safasfsafasf\"]', '01/01/2018', 'Small', NULL, 'Private Limited', NULL, NULL, NULL, '5 - 24', '25 - 49', '6% - 15%', '26% - 35%', '< 10%', '< 5%', '1.0 = 1.5', NULL, '50 - 100', 'Domestic', 'asdmnasnfiaskdnaKDMASJKNDAjsnsajdaNSJADADSADhttps://www.instagram.com/natures_spice/SADASDASFASFSAFSAFSAFSAFAFSFASFSAFASFASF', 'https://www.instagram.com/natures_spice/SADASDASFASFSAFSAFSAFSAFAFSFASFSAFASFASF', NULL, NULL, NULL, NULL, NULL, '  https://www.instagram.com/natures_spice/SADASDASFASFSAFSAFSAFSAFAFSFASFSAFASFASF', '  https://www.instagram.com/natures_spice/SADASDASFASFSAFSAFSAFSAFAFSFASFSAFASFASF', '  https://www.instagram.com/natures_spice/SADASDASFASFSAFSAFSAFSAFAFSFASFSAFASFASF', '  https://www.instagram.com/natures_spice/SADASDASFASFSAFSAFSAFSAFAFSFASFSAFASFASF', '  https://www.instagram.com/natures_spice/SADASDASFASFSAFSAFSAFSAFAFSFASFSAFASFASF', NULL, 'uploads/1736502899-24703/1736506296_onKxOgFi_Report.pdf', 'uploads/1736502899-24703/1736506296_onKxOgFi_Report1.pdf', 'uploads/1736502899-24703/1736506296_onKxOgFi_Report2.pdf', 'uploads/1736502899-24703/1736506296_onKxOgFi_Report3.pdf', 'uploads/1736502899-24703/1736506296_onKxOgFi_Report4.pdf', NULL, NULL, NULL, NULL, 'Humaid Shaikh', 'humaidshaikh29@gmail.com', '7738066669', '6', 1, NULL, 3, 1, 'no', '0', NULL, '2025-02-05 01:13:57', '2025-01-10 09:57:34'),
(36, '1736397381-49351', '9_MSME', 'SANJAY AGARWAL', 'sanjayagarwal@apnagodam.com', 'founder ', 'SINGODWALA WAREHOUSING AND LOGISTICS PRIVATE LIMITED', 'Rajasthan', 'Jaipur ', 'https://apnagodam.com/', NULL, '[\"Plot No 16, Sector 9, \",\"Vidhyadhar Nagar \",\"Jaipur \"]', '18/07/2016', 'Small', NULL, 'Private Limited', NULL, NULL, NULL, '5 - 24', '5 - 24', '> 36%', '> 36%', '< 10%', '> 20%', '> 3.0', NULL, '50 - 100', 'Domestic', 'Apna Godam is Private Sector Online Mandi Notified by the Government. This is a new Concept as 21 State  Governments have now modified their APMC Laws and opened up this space for private companies. \r\n\r\nOnline Trading platforms (like us) Will now act like local commodity Exchange. We have developed a mobile application which provides price discovery and Secure Trading in Agri Commodities.  ', 'The biggest problem for the farmer is that he is told price of the Produce \"AFTER\"  the commodity is brought in APMC. We provide secure and transparent price discovery where farmer can get the price discovery done \"BEFORE\" the commodity is brought to Warehouse or any processing Factory. \r\n\r\nBoth Buyers and sellers deposit 10% margin as security. This way we have brought Exchange like service for masses . So far this facility was available to class of customer only.', NULL, NULL, NULL, NULL, NULL, 'Selling Tooth Paste and selling Agri produce have absolutely different challenges. While there are may e commerce players in the industry for the former but NONE for the later. Because the Agricultural produce is not standard, It has lower shelf life and market is unorganized due to State level Government Policy which is not uniform. \r\n\r\nHence we have brought this Grain Commerce Platform which is amazon for Farmers.', ' We started with 1 crore GMV in first Year and then 25 Crore in second year and 42 Crore in third year. This year we will cross 100 Crores. ', 'Transport of Agri commodity just for price discovery is a waste exercise. It increases cost to the farmer and waste the Fuel. 30% of the transport in Agri is Redundant only because of the faulty Trading methods. ', 'India produces 33 Crore Metric Ton of grains. The size of the Industry is behemoth.  The prudent way of expansion is generally to deep digger at one place and then move to other. But in Our case this is different. We Expand commodity level. \r\n\r\nIf we want to be master of Maize commodity then we HAVE to be present in all states where Maize is produced. Because unless we have connect with the PAN India buyers then only our price discovery will be perfect. We are going in all Maize growing States.', 'Due to our Unique Trading Module the Occupancy in the warehouses have increased. Where most of the Warehouses are suffering from occupancy issues if any warehouses is equipped with our Business model then the Occupancy of the warehouses increases. \r\n\r\nTransforming the  \"Warehouses\" into \" Delivery Centers\" is our biggest positive change we have brought. It has not only solved the market linkage problem of the farmer but also solved the poor occupancy issue of the warehouses.  ', NULL, 'uploads/1736397381-49351/1736417352_LU5FZile_UAM_compressed.pdf', 'uploads/1736397381-49351/1736417353_LU5FZile_18_07_2016_CERTIFICATE_OF_INCORPORATION_compressed.pdf', 'uploads/1736397381-49351/1736417353_LU5FZile_One_Pager_Apna_Godam_2_0.pdf', 'uploads/1736397381-49351/1736417353_LU5FZile_MGP_Launch.pdf', 'uploads/1736397381-49351/1736417353_LU5FZile_Awards.pdf', NULL, NULL, NULL, NULL, 'Sanjay Agarwal', 'sanjayagarwal@apnagodam.com', '9314142089', '5', 1, NULL, 0, 1, 'no', '0', NULL, '2025-02-07 12:01:03', '2025-01-09 04:43:13'),
